import * as actions from './actions';
import mutations from './mutations';
import * as getters from './getters';

export default {
  state() {
    return {
      postList: {},
      postSuccess: {},
      postError: {},
      postDetails:{},
    };
  },
  mutations,
  actions,
  getters,
};
